define('text!views/base64.html',[],function () { return '<section>\n    <h2>Base64 Converter</h2>\n    <p>To convert between <a href="http://en.wikipedia.org/wiki/Base64">Base64</a> and plain text, simply type/paste your data into the appropriate tab and click the button (or use accesskeys <code>B</code> and <code>T</code>).\n    <ul class="nav nav-tabs" id="myTab">\n      <li><a href="#tab_base64" data-toggle="tab" accesskey="b">Base64</a></li>\n      <li><a href="#tab_text" data-toggle="tab" accesskey="t">Text</a></li>\n    </ul>\n    <div class="tab-content">\n      <div class="tab-pane active" id="tab_base64">\n      \t<textarea id="textarea_base64" class="span12" rows="15">SGVsbG8gV29ybGQh</textarea>\n      \t<button class="btn btn-primary" type="button">Decode</button>\n      </div>\n      <div class="tab-pane" id="tab_text">\n      \t<textarea id="textarea_text" class="span12" rows="15">Hello World!</textarea>\n      \t<button class="btn btn-primary" type="button">Encode</button>\n      </div>\n    </div>\n</section>\n\n<p/>\n<footer>&copy; Erik Larsson 2013</footer>';});

